import Nav from './components/Nav'
import PageLeft from './components/PageLeft'
import PageRight from './components/PageRight'
import './styles.css'
import { useState } from 'react'

function App() {
  // Statisk liste for overskrifter p책 sidene
  const headerList = [
    {
      id: 1,
      headerLeft: 'Design i Human',
      headerRight: 'Design is human. Design making ideas real',
    },
    {
      id: 2,
      headerLeft: 'Programming Delivers Solutions',
      headerRight:
        'Programming Delivers Solutions. Engineering and Development Thrive on Strong Design.',
    },
    {
      id: 3,
      headerLeft: 'Support is Trust.',
      headerRight: 'Support is Trust. Product Life Cycle Beyond Development',
    },
  ]

  const [content, setContent] = useState(headerList[0])
  // console.log(content)

  // onClick for 책 trigge noe skal skj
  const handleClick = (event) => {
    event.preventDefault()
    // console.log('clicked')

    const button = event.currentTarget
    console.log(button.id)
    const { id } = button
    setContent(headerList[id])
    console.log(content)
  }

  return (
    <>
      <Nav handleClick={handleClick} />
      <main>
        <PageLeft headerList={headerList} />
        <PageRight />
      </main>
    </>
  )
}

export default App
